/**
 * @param {number[][]} grid
 * @return {number[]}
 */
var goodSubsetofBinaryMatrix = function(grid) {
    const m = grid.length, n = grid[0].length;
    for (let k = 1; k <= m; ++k) { // Length of subset
        const subsets = [];
        // Generate all combinations of rows of length k
        const generateCombinations = (start, path) => {
            if (path.length === k) {
                subsets.push([...path]);
                return;
            }
            for (let i = start; i <= m - (k - path.length); ++i) {
                path.push(i);
                generateCombinations(i + 1, path);
                path.pop();
            }
        };
        generateCombinations(0, []);

        // Check each subset
        for (const subset of subsets) {
            let isValid = true;
            for (let j = 0; j < n && isValid; ++j) { // Check each column
                let sum = 0;
                for (const rowIndex of subset) {
                    sum += grid[rowIndex][j];
                }
                if (sum > Math.floor(k / 2)) isValid = false; // Subset is not good
            }
            if (isValid) return subset.map(i => i); // Return indices of a good subset
        }
    }
    return []; // No good subset found
};
